import './App.css';
import Project from './components/Project/Project.js';

const projectsData = {
    guessNumber: {
        name: 'Guess the number',
        image: '',
        link: 'https://kirilyanev.github.io/Guess-the-number/',
        description: 'A simple game where you have to guess a random number.'
    },
};

function App() {
    return (
        <div>
            <h1>This website is currently under construction</h1>
            {projectsData.map(data => {
                <Project projectData={data} />;
            })}
            <Project />
        </div>
    );
}

export default App;
